"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-06-26-welcome/index.md","source":"@site/blog/2023-06-26-welcome/index.md","title":"Welcome to the docs!","description":"Docusaurus Plushie","date":"2023-06-26T00:00:00.000Z","formattedDate":"June 26, 2023","tags":[{"label":"facebook","permalink":"/blog/tags/facebook"},{"label":"hello","permalink":"/blog/tags/hello"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.01,"hasTruncateMarker":false,"authors":[{"name":"Author three","title":"blah maintainer","url":"https://sebastienlorber.com","imageURL":"https://github.com/slorber.png","key":"slorber"},{"name":"Author two","title":"Front End","url":"https://github.com/yangshun","imageURL":"https://github.com/yangshun.png","key":"yangshun"}],"frontMatter":{"slug":"welcome","title":"Welcome to the docs!","authors":["slorber","yangshun"],"tags":["facebook","hello","docusaurus"]},"nextItem":{"title":"V1 (frontend API)","permalink":"/blog/api-version-1"}},"content":"![Docusaurus Plushie](./tiktok-love.jpeg)"},{"id":"api-version-1","metadata":{"permalink":"/blog/api-version-1","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-04-20-API-test.md","source":"@site/blog/2023-04-20-API-test.md","title":"V1 (frontend API)","description":"The alpha version of ttgo has three APIs; In this article the parameters and the data format is detailed.","date":"2023-04-20T00:00:00.000Z","formattedDate":"April 20, 2023","tags":[{"label":"API","permalink":"/blog/tags/api"},{"label":"alpha","permalink":"/blog/tags/alpha"}],"readingTime":2.83,"hasTruncateMarker":true,"authors":[{"name":"bloh","title":"Blah?","url":"https://github.com/wgao19","image_url":"https://github.com/wgao19.png","imageURL":"https://github.com/wgao19.png"}],"frontMatter":{"slug":"api-version-1","title":"V1 (frontend API)","authors":{"name":"bloh","title":"Blah?","url":"https://github.com/wgao19","image_url":"https://github.com/wgao19.png","imageURL":"https://github.com/wgao19.png"},"tags":["API","alpha"]},"prevItem":{"title":"Welcome to the docs!","permalink":"/blog/welcome"}},"content":"The `alpha` version of `ttgo` has three APIs; In this article the parameters and the data format is detailed.\\n\\n\x3c!--truncate--\x3e\\n\\n## Videos most present globally\\n\\nReturns a list of all the videos that appeared in more than one country, in the selected time window.\\n\\n* url: `https://ttgo.trex.zone/foryourecommendations/global`\\n* parameters:\\n  * `start`: date to begin the window of time considered, format `YYYY-MM-DD` (default, _15 days ago_)\\n  * `end`: date to end the window of time considered, format `YYYY-MM-DD` (default, _today_)\\n  * `n`: number of videos to return (default, `20`)\\n  * `format`: it can be `csv` or `json` (default, `json`)\\n* CSV file produced has a name such as `global-$NUMBER-OF-VIDEOS.csv` which is the same as `n`\\n* note: in this API USA is considered only once, not the 52 states.\\n\\n### CSV format for `/global` API\\n\\n|Field Name       |Example row n.1         |Example row n.2         |\\n|-----------------|------------------------|------------------------|\\n|name             |Guam                    |Panama                  |\\n|three            |GUM                     |PAN                     |\\n|two              |GU                      |PA                      |\\n|dataFormatVersion|0.1                     |0.1                     |\\n|videoId          |7242021356601101594     |7242021356601101594     |\\n|musicId          |7242021338859244315     |7242021338859244315     |\\n|description      |I hope you will appreciate my little house. \ud83c\udfe0 It is for you #learnfromkhaby  #comic #commedy  |I hope you will appreciate my little house. \ud83c\udfe0 It is for you #learnfromkhaby  #comic #commedy  |\\n|authorName       |khaby.lame              |khaby.lame              |\\n|musicTitle       |suono originale         |suono originale         |\\n|musicAuthor      |Khabane lame            |Khabane lame            |\\n|videoOccurrencies|261                     |261                     |\\n|samplingTime     |2023-06-08T16:31:21.858Z|2023-06-08T16:31:21.858Z|\\n|createTime       |2023-06-07T19:01:43.000Z|2023-06-07T19:01:43.000Z|\\n|likes            |271400                  |271400                  |\\n|comments         |3170                    |3170                    |\\n|shares           |557                     |557                     |\\n\\nAs you can note, the same video is duplicated. it is present for every country.\\n\\n## topByCountry\\n\\nReturns a list, with the same number of videos for each country, the most present video recommended in the selected time window.\\n\\n* url: `https://ttgo.trex.zone/foryourecommendations/topByCountry`\\n* parameters:\\n  * `start`: date to begin the window of time considered, format `YYYY-MM-DD` (default, _15 days ago_)\\n  * `end`: date to end the window of time considered, format `YYYY-MM-DD` (default, _today_)\\n  * `n`: number of videos to return (default, `5`)\\n  * `format`: it can be `csv` or `json` (default, `json`)\\n* CSV file produced has a name such as `topByCountry-$NUMBER-OF-VIDEOS.csv`\\n* note: in this API USA is considered only once, not the 52 states.\\n\\n### CSV format for `/topByCountry`\\n\\n_Note: there is a small bug, seems the country code/name is not present: I\'m checking it next week_\\n\\n## raw data by Country\\n\\n* url: `https://ttgo.trex.zone/foryourecommendations/country/$THREE_LETTER_COUNTRY_CODE`\\n* about  the url country code, this is the standard we follow: [ISO_3166-1 alpha-3](https://en.wikipedia.org/wiki/ISO_3166-1_alpha-3)\\n* _examples_: `ARG` is Argentina, `PAK` is Pakistan\\n* parameters:\\n  * `start`: date to begin the window of time considered, format `YYYY-MM-DD` (default, _15 days ago_)\\n  * `end`: date to end the window of time considered, format `YYYY-MM-DD` (default, _today_)\\n  * `n`: number of videos to return (default, `1000`)\\n  * `format`: it can be `csv` or `json` (default, `json`)\\n* CSV file produced has a name such as `country-$THREE_LETTER_CODE-$NUMBER-OF-VIDEOS.csv`\\n* note: in this API you can\'t query USA individual states.\\n\\n### CSV format for `/country/$THREE_LETTER_COUNTRY_CODE`\\n\\n|Field Name       |Example row n.1         |Example row n.2         |\\n|-----------------|------------------------|------------------------|\\n|dataFormatVersion|0.1                     |0.1                     |\\n|name             |Argentina               |Argentina               |\\n|three            |ARG                     |ARG                     |\\n|two              |AR                      |AR                      |\\n|videoId          |7248720457984150810     |7234862712428236037     |\\n|musicId          |7242380100220504875     |7234862746257050374     |\\n|description      |Necesito que @Karim me ense\xf1e a romperla bien etiquetenle \ud83d\ude4f\ud83c\udffc\ud83e\uddec#forearms #fuerza #kratos #retosfitness #gripstrength #nathaa_c  |                        |\\n|authorName       |nathaa_c                |leandroduan             |\\n|musicAuthor      |Constant Gains          |leandroduan             |\\n|samplingTime     |2023-06-30T16:21:43.213Z|2023-06-30T16:21:43.213Z|\\n|createTime       |2023-06-25T20:17:36.000Z|2023-05-19T12:02:24.000Z|\\n|likes            |479900                  |314400                  |\\n|comments         |1001                    |1949                    |\\n|shares           |331                     |3100                    |\\n|musicDuration    |64                      |60                      |\\n|dataFormatVersion|0.1                     |0.1                     |"}]}')}}]);